import React, { useState, useEffect } from 'react';
import './BookingsPage.css';
import logo from './logo.png';
import BookingDetailsModal from './BookingDetailsModal';

function BookingsPage() {

  const [selectedBooking, setSelectedBooking] = useState(null);
  const [sortOption, setSortOption] = useState('date');
  const [searchQuery, setSearchQuery] = useState('');
  const [filterOption, setFilterOption] = useState('');
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [currentPage, setCurrentPage] = useState(1);
  const bookingsPerPage = 9;

    useEffect(() => {
    
    setTimeout(() => {
      setBookings([
      {
        id: 1,
        hotelName: 'Luxury Hotel',
        checkIn: '2024-09-01',
        checkOut: '2024-09-07',
        guests: 2,
        price: '$1200',
        image: 'pictures/download (6).jpg',
        bookingId: 'BK12345',
        contactNumber: '+1 234 567 890',
      },
      {
        id: 2,
        hotelName: 'Beachside Resort',
        checkIn: '2024-10-15',
        checkOut: '2024-10-20',
        guests: 4,
        price: '$2000',
        image: 'pictures/download (8).jpg',
        bookingId: 'BK67890',
        contactNumber: '+1 234 567 891',
      },
      {
        id: 3,
        hotelName: 'Mountain Retreat',
        checkIn: '2024-11-05',
        checkOut: '2024-11-10',
        guests: 3,
        price: '$1500',
        image: 'pictures/download (7).jpg',
        bookingId: 'BK11223',
        contactNumber: '+1 234 567 892',
      },
      {
        id: 4,
        hotelName: 'Luxury Hotel',
        checkIn: '2024-09-01',
        checkOut: '2024-09-07',
        guests: 2,
        price: '$1200',
        image: 'pictures/download (6).jpg',
        bookingId: 'BK12345',
        contactNumber: '+1 234 567 890',
      },
      {
        id: 5,
        hotelName: 'Beachside Resort',
        checkIn: '2024-10-15',
        checkOut: '2024-10-20',
        guests: 4,
        price: '$2000',
        image: 'pictures/download (8).jpg',
        bookingId: 'BK67890',
        contactNumber: '+1 234 567 891',
      },
      {
        id: 6,
        hotelName: 'Mountain Retreat',
        checkIn: '2024-11-05',
        checkOut: '2024-11-10',
        guests: 3,
        price: '$1500',
        image: 'pictures/download (7).jpg',
        bookingId: 'BK11223',
        contactNumber: '+1 234 567 892',
      },
      {
        id: 7,
        hotelName: 'Luxury Hotel',
        checkIn: '2024-09-01',
        checkOut: '2024-09-07',
        guests: 2,
        price: '$1200',
        image: 'pictures/download (6).jpg',
        bookingId: 'BK12345',
        contactNumber: '+1 234 567 890',
      },
      {
        id: 8,
        hotelName: 'Beachside Resort',
        checkIn: '2024-10-15',
        checkOut: '2024-10-20',
        guests: 4,
        price: '$2000',
        image: 'pictures/download (8).jpg',
        bookingId: 'BK67890',
        contactNumber: '+1 234 567 891',
      },
      {
        id: 9,
        hotelName: 'Mountain Retreat',
        checkIn: '2024-11-05',
        checkOut: '2024-11-10',
        guests: 3,
        price: '$1500',
        image: 'pictures/download (7).jpg',
        bookingId: 'BK11223',
        contactNumber: '+1 234 567 892',
      },

      ]);
      setLoading(false);
    }, 1000);
  }, []);

    const sortedBookings = bookings.sort((a, b) => {
      if (sortOption === 'price') {
        return parseFloat(a.price.replace('$', '')) - parseFloat(b.price.replace('$', ''));
      } else if (sortOption === 'date') {
        return new Date(a.checkIn) - new Date(b.checkIn);
      }
      return 0;
    });
  

    const filteredBookings = sortedBookings.filter(booking =>
      booking.hotelName.toLowerCase().includes(searchQuery.toLowerCase()) &&
      (filterOption === '' || booking.price.replace('$', '') <= filterOption)
    );
  
    const indexOfLastBooking = currentPage * bookingsPerPage;
    const indexOfFirstBooking = indexOfLastBooking - bookingsPerPage;
    const currentBookings = filteredBookings.slice(indexOfFirstBooking, indexOfLastBooking);
    
  
  
  const handleSearchChange = (event) => {
      setSearchQuery(event.target.value);
    };
  
    const handleFilterChange = (event) => {
      setFilterOption(event.target.value);
    };
  
    const handleSortChange = (event) => {
      setSortOption(event.target.value);
    };
  
    const handleViewDetails = (booking) => {
      setSelectedBooking(booking);
    };
  
    const handleCloseModal = () => {
      setSelectedBooking(null);
    };

    const handleCancelBooking = (id) => {
      setBookings(bookings.filter(booking => booking.id !== id));
    };

    const handleClearFilters = () => {
      setSearchQuery('');
      setFilterOption('');
      setSortOption('date');
    };
  
    const handlePageChange = (pageNumber) => {
      setCurrentPage(pageNumber);
    };

    if (loading) {
      return <div className="loading">Loading...</div>;
    }
    
  
    return (
      <div className="bookings-page">
        <div className="logo-container">
          <img src={logo} alt="Hotel Reservations App" className="home-logo" />
        </div>
  
        <h1 className='h1booking'>Your Bookings</h1>
  
        <div className="filters">
          <input
            type="text"
            placeholder="Search by hotel name"
            value={searchQuery}
            onChange={handleSearchChange}
            className="search-input"
          />
          <select value={filterOption} onChange={handleFilterChange} className="filter-select">
            <option value="">No Filter</option>
            <option value="1000">Under $1000</option>
            <option value="1500">Under $1500</option>
            <option value="2000">Under $2000</option>
          </select>
          <select value={sortOption} onChange={handleSortChange} className="sort-select">
            <option value="date">Sort by Date</option>
            <option value="price">Sort by Price</option>
          </select>
        </div>
  
        <div className="bookings-list">
          {filteredBookings.length > 0 ? (
            filteredBookings.map((booking) => (
              <div className="booking-item" key={booking.id}>
                <img src={booking.image} alt={booking.hotelName} className="booking-image" />
                <div className="booking-details">
                  <h2>{booking.hotelName}</h2>
                  <p><strong>Check-In:</strong> {booking.checkIn}</p>
                  <p><strong>Check-Out:</strong> {booking.checkOut}</p>
                  <p><strong>Guests:</strong> {booking.guests}</p>
                  <p><strong>Price:</strong> {booking.price}</p>
                  <p><strong>Booking ID:</strong> {booking.bookingId}</p>
                  <p><strong>Contact Number:</strong> {booking.contactNumber}</p>
                </div>
                <div className="booking-actions">
                  <button className="view-button" onClick={() => handleViewDetails(booking)}>View Details</button>
                  <button className="cancel-button" onClick={() => handleCancelBooking(booking.id)}>Cancel Booking</button>
                </div>
              </div>
            ))
          ) : (
            <p>No bookings found.</p>
          )}
          {selectedBooking && (
            <BookingDetailsModal booking={selectedBooking} onClose={handleCloseModal} />
          )}
        </div>


        <div className="pagination">
    <button className="prev-page">&laquo; Prev</button>
    <span className="page-number">1</span>
    <span className="page-number">2</span>
    <span className="page-number">3</span>
    <span className="page-number">...</span>
    <span className="page-number">10</span>
    <button className="next-page">Next &raquo;</button>
  </div>
      </div>
    );
  }
  
  export default BookingsPage;
